import React from 'react';

function User({ user }) {
    return (
        <div>
            <b>{user.username}</b> <span>({user.email})</span>
        </div>
    );
}

function countBiggerThanTen(numbers) {
    let count = 0;
    numbers.forEach(element => {
        if(element > 10) count++;
    });
}

const count = countBiggerThanTen([1, 2, 3, 5, 10, 20, 30, 40, 50, 60]);
console.log(count);

function UserList() {
    const users = [
        {
            id: 1,
            username: 'bokjiho',
            email: 'bok.jiho@gmail.com',
        },
        {
            id: 2,
            username: 'jiminbok',
            email: 'jiminbok@gmail.com',
        },
        {
            id: 3,
            username: 'ockmilee',
            email: 'leeockmi121@gmail.com',
        },
    ];

    return (
        <div>
            <User user={users[0]} />
            <User user={users[1]} />
            <User user={users[2]} />
        </div>
    );
}

export default UserList;
